const initialDate:any = new Date();

export const imagesData:any[] = images.map((url, index) => {
  const rating = index < 10 ? 1 : index < 20 ? 2 : 3;
  const views = index < 10 ? 30 : index < 20 ? 20 : 10;
  const date = initialDate - index * 1000;
  return {
    id: uuidv4(),
    url,
    rating,
    date,
    views,
  };
});